l have strong creative skills and a portfolio of work which demonstrates their passion for illustrative design and typography. This candidate will have experiences in working with numerous different design platforms such as digital and print forms.</p>\n            <p></p>\n        </div>\n    </div>\n    <div class=\"row\">\n        <div class=\"col-lg-1\"></div>\n        <div class=\"col-lg-10\">\n            <div class=\"box-image mt-30 mb-30\">\n                [youtube-video image=\"general/career-img.png\" with_container=\"no\"]https://www.youtube.com/watch?v=SlPhMPnQ58k[/youtube-video]\n            </div>\n        </div>\n    </div>\n    <div class=\"row\">\n        <div class=\"col-lg-2\"></div>\n        <div class=\"col-lg-8\">\n            <h2 class=\"text-heading-4\">Essential Knowledge, Skills, and Experience</h2>\n            <ul>\n                <li>A portfolio demonstrating well thought through and polished end to end customer journeys</li>\n                <li>5+ years of industry experience in interactive design and / or visual design</li>\n                <li>Excellent interpersonal skills </li>\n                <li>Aware of trends in mobile, communications, and collaboration</li>\n                <li>Ability to create highly polished design prototypes, mockups, and other communication artifacts</li>\n                <li>The ability to scope and estimate efforts accurately and prioritize tasks and goals independently</li>\n                <li>History of impacting shipping products with your work</li>\n                <li>A Bachelor’s Degree in Design (or related field) or equivalent professional experience</li>\n                <li>Proficiency in a variety of design tools such as Figma, Photoshop, Illustrator, and Sketch</li>\n            </ul>\n            <p></p>\n            <h2 class=\"text-heading-4\">Essential Knowledge, Skills, and Experience</h2>\n            <ul>\n                <li>Designing user experiences for enterprise software / services</li>\n                <li>Creating and applying established design principles and interaction patterns</li>\n                <li>Aligning or influencing design thinking with teams working in other geographies</li>\n            </ul>\n            <p></p>\n            <h2 class=\"text-heading-4\">Essential Knowledge, Skills, and Experience</h2>\n            <p>Product knowledge: Deeply understand the technology and features of the product area to which you are assigned.</p>\n            <p>Research: Provide human and business impact and insights for products.</p>\n            <p>Deliverables: Create deliverables for your product area (for example competitive analyses, user flows, low fidelity wireframes, high fidelity mockups, prototypes, etc.) that solve real user problems through the user experience.</p>\n            <p>Communication: Communicate the results of UX activities within your product area to the design team department, cross-functional partners within your product area, and other interested Superformula team members using clear language that simplifies complexity.</p>\n            <div class=\"border-bottom mt-50 mb-50\"></div>\n\n            [apply-now primary_url=\"/\" primary_title=\"Apply now\" secondary_url=\"/contact\" secondary_title=\"Contact\"][/apply-now]\n        </div>\n    </div>\n</div>\n\n[newsletter name=\"newsletter\" title=\"Subscribe our newsletter\" subtitle=\"By clicking the button, you are agreeing with our Term & Conditions\" link=\"/\" text_link=\"Term & Conditions\" image=\"general/img-newsletter.png\" mini_image=\"general/chart.png\"][/newsletter]\n',1,NULL,'page-detail',NULL,'published','2024-02-24 01:47:00','2024-02-24 01:47:00'),(21,'About Us 2','<div>[hero-banner title=\"Start Your Dream Business Today\" highlight_text=\"What We Do, What You Get\" subtitle=\"Integrated workflow designed for product teams. We create world-class development and branding\" image=\"general/banner7.png\" bg_color=\"#990099\" primary_title=\